						<div itemprop="articleBody">
		<p><strong>KØBENHAVN KALDER - ØRESUNDSBROEN ÅBNER</strong></p>
<p><em><span style="text-decoration: underline;">Svenske og danske kvindelige læger mødes i København den 25 august 2000</span></em></p>
<p><strong>Formål: <br /></strong>Faglig snak og at lære hinanden at kende.<br />Dagen igennem har vi faglige møder - om aftenen går vi tivoli!</p>
<p>Oplysninger vil løbende blive sat på foreningens web-site: <a href="http://www.quindoc.dk/"><span style="text-decoration: underline;"><span style="color: #333333;">www.quindoc.dk</span></span></a></p>
<p><strong>Netgrupper forbereder emner til mødet!<br /></strong>En netgruppe har ca. 10 medlemmer (5svenske, 5 danske), som selv vælger det emne de vil forelægge på mødet. Det kan f.eks. være kvindelige lægers arbejdsforhold, teenage-graviditeter miljømæssige forhold i vore lande, ældreomsorg - emnerne er utallige. Niveauet vil blive højt, da de deltagende læger behandler deres interesseområder.</p>
<p><strong>Du kan deltage i en netgruppe</strong> ved at tilmelde dig på&nbsp;<span style="text-decoration: underline;"><span style="color: #333333;"></span></span><a href="mailto:skriv@quindoc.dk">skriv@quindoc.dk</a> <span style="display: none;"><br /><em>(Husk at skrive dit navn, postadresse og E-mail)<br /></em>Via E-mail kan lægerne skrive til hinanden og diskutere fagligt. Måske kan de enkelte grupper også mødes hos hinanden inden den 25. august.</p>
<p>På gensyn i København<br />Danske Kvindelige Lægers Forening</p>
<p><strong>Aggi Kjær</strong> formand<br />Tlf.nr.: 4498 0102<br />Fax: 4498 7744<br />E-mail: <a href="mailto:aggi@dadlnet.dk"><span style="text-decoration: underline;"><span style="color: #333333;">aggi@dadlnet.dk</span></span></a></p>	</div>

	
